import React from 'react'

class Columns extends React.Component {
  constructor (props) {
    super(props)
    this.state = {
      'showLoading': true,
      'showError': false
    }
    this.elements = []
  }
  componentDidMount () {
    fetch(`http://http://46.188.118.134:8082/navigations?type=f=${this.props.type}`)
      .then(response => response.json())
      .then(response => {
        response
          .pop()
          .articles
          .sort((a, b) => a.createdAt < b.createdAt ? 1 : -1)
          .forEach(article => {
            if (article.is_active === true) {
              this.elements.push(
                <div className='column is-3'>
                  <div class='container'>
                    <div class='columns'>
                      <div class='column is-3 is-offset-2'>
                        <ul>
                          <li><a href='#'>{article.name_ru}</a></li>
                        </ul>
                      </div>
                    </div>
                  </div>
                </div>
              )
            }
          })
        this.setState({
          'showLoading': false,
          'showError': false
        })
      })
      .catch(error => {
        console.error(error)
        this.setState({
          'showLoading': false,
          'showError': true
        })
      })
  }
  render () {
    return (
      <footer class='footer'>
        <div class='container'>
          <div class='columns'>
            <div class='column is-3 is-offset-2'>

              <ul>
                <li><a href='#'>Приемная комиссия</a></li>
                <li><a href='#'>Институты</a></li>
                <li><a href='#'>Поступающим</a></li>

              </ul>
            </div>
            <div class='column is-3'>

              <ul>
                <li><a href='#'>Сведения </a></li>
                <li><a href='#'>Структура Университета</a></li>
                <li><a href='#'>История</a></li>

              </ul>
            </div>
            <div class='column is-4'>

              <ul>
                <li><a href='#'>Сотрудникам</a></li>
                <li><a href='#'>Ученый совет</a></li>
                <li><a href='#'>Выпускникам</a></li>

              </ul>
            </div>
          </div>

        </div>

      </footer>
    )
  }
}
export default Columns
